import React, { useState } from "react"; 
import Header from "./Header";
import { Link } from "react-router-dom";
import Contact from "./Contact";

const Copywrite=()=>{
    const year=new Date();
    const [words,setWord]=useState("")
    const clickbutton=()=>{
        const word="hello why do you press subscribe" 
       setWord(word)  
    }
     return(
        <div>
     <p>"this version is Copyright &copy; {year.getFullYear()} "</p>
    <button onClick={clickbutton}>Subscrib</button><p>{words}</p>
 

    <Header name=" sachin " age="80"></Header>
    <nav>
        <Link to ="/footer">Footer</Link><br />
        <Route path="contact" element={<Contact/>}/>
         <Link to="/contact">Contact</Link><br />
    </nav>
    </div>)
}

export default Copywrite
